#include <string>
#include <iostream>
#include <assert.h>
#include <vector>

using namespace std;

typedef string::iterator si;

string lookAhead(si* ita, si* itb, si* eita, si* eitb, char* ref) {
  if (**ita < **itb) {
    if (ref == NULL) {
      ++(*ita);
    }
    else {
      return "A";
    }
  }
  else if (**ita > **itb) {
    if (ref == NULL) {
      ++(*itb);
    }
    else {
      return "B";
    }
  }
  else {
    if (ref != NULL && **ita > *ref) {
    }
    else if ((*ita) + 1 != *eita && (*itb) + 1 != *eitb) {
      if (ref == NULL) {
        ref = &**ita;
      }
      ++(*ita);
      ++(*itb);
      lookAhead(ita, itb, eita, eitb, ref);
    }
    else {
      if ((*ita) + 1 == *eita) {
        cout << "String A at end of line!" << endl;
        ++(*ita);
      }
      if ((*itb) + 1 == *eitb) {
        ++(*itb);
        cout << "String B at end of line!" << endl;
      }
    }
  }
}

string morganAndString(string a, string b) {
  string ans;
  si ita = a.begin();
  si itb = b.begin();
  si eita = a.end();
  si eitb = b.end();
  si c_ita, c_itb, it;
  string out = "";
  while (ita != eita && itb != eitb) {
    c_ita = ita;
    c_itb = itb;
    char* ref = NULL;
    string s = lookAhead(&c_ita, &c_itb, &eita, &eitb, ref);
    if (s == "A") {
      c_itb = itb;
    }
    else if (s == "B") {
      c_ita = ita;
    }
    for (it = ita; it != c_ita; ++it) {
      out.push_back(*it);
      cout << "A " << *it << endl;
    }
    ita = it;
    for (it = itb; it != c_itb; ++it) {
      out.push_back(*it);
      cout << "B " << *it << endl;
    }
    itb = it;
  }
  cout << "Out of while loop!" << endl;
  for (it = ita; it != eita; ++it) {
    out.push_back(*it);
    cout << "A " << *it << endl;
  }
  for (it = itb; it != eitb; ++it) {
    out.push_back(*it);
    cout << "B " << *it << endl;
  }
  return string(out.begin(), out.end());
}

int main() {
  assert(morganAndString("ABACABA", "ABACABA") == "AABABACABACABA");
  assert(morganAndString("BBBB", "AAAA") == "AAAABBBB");
  assert(morganAndString("JACK", "DANIELS") == "DAJACKNIELS");
  string a = "";
  string b = "";
  string c = "";
  cout << "fking long" << endl;
  assert (morganAndString(a, b) == c);
  cout << "All Tests Passed!" << endl;
}
